import { Component, OnInit } from '@angular/core';
import { BookService } from '../book.service';
import { Book } from '../Book';


@Component({
  selector: 'app-add-book',
  templateUrl: './add-book.component.html',
  styleUrls: ['./add-book.component.css']
})
export class AddBookComponent implements OnInit{
  ngOnInit(): void {
    throw new Error('Method not implemented.');
  }
constructor(private bookservice:BookService){

}

book:Book=new Book();

  addBook(){
    this.bookservice.addBook(this.book);

  }

}
<p>add-book works!</p>
<table border="5" cellspacing="5" padding="5">
    <tr>
    Enter the Book ID <input type=number [(ngModel)]="book.BookId">
    Enter the Book Name<input type="text" [(ngModel)]="book.BookName">
    Enter the Book Price<input type=number [(ngModel)]="book.BookPrice">
    </tr>

</table>
<button (click)="addBook()">Add</button>
